import React from 'react';


const ImageList = (props) => {
    console.log("images"+props.image)
    return (
        <div>ImageList:{
            props.image.map((img)=>{
                return(
                    <img src={img}></img>
                )
            })
        }</div>
    );
};
export default ImageList;
